button.onclick:
///$debug
meibo.showField("error", false);
var missionId = meibo.getFieldValue("TMN_ID");
var comment = meibo.getFieldValue("COMMENT");
var /*String*/ userId = meibo.getGlobalVar(GLOBALVAR_CURRENT_USER_ID);

meibo.logInfo("Rejet de la mission " + missionId + " par " + meibo.getUserDn());
updateMissionStatus(missionId, userId, "MOD", comment);
meibo.setWorkflowVariable("comment", comment);
meibo.setWorkflowVariable("secondLevelValidated", "false");
meibo.completeCurrentWorkflowTask();
meibo.setActiveTab(3);

///$debug
meibo.showField("error", false);
var missionId = meibo.getFieldValue("TMN_ID");
var comment = meibo.getFieldValue("COMMENT");
var /*String*/ userId = meibo.getGlobalVar(GLOBALVAR_CURRENT_USER_ID);

meibo.logInfo("Validation de la mission " + missionId + " par " + meibo.getUserDn());
updateMissionStatus(missionId, userId, "VAL", comment);
meibo.setWorkflowVariable("comment", comment);
meibo.setWorkflowVariable("secondLevelValidated", "true");
meibo.completeCurrentWorkflowTask();
meibo.setActiveTab(2);
